import React from "react";

function AboutPage() {
	return (
		<div>
			<h1>About This App</h1>
			<p className="my-1">This is a full stack React app Keeping contacts</p>
			<p className="bg-dark p">
				<strong>1.0.4</strong>
			</p>
		</div>
	);
}

export default AboutPage;
